INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1297842, 'GOAT: Como cabras', 'Will es una pequeña cabra con grandes sueños que recibe una oportunidad única en la vida para unirse a los profesionales y jugar al rugebol, un deporte de alta intensidad, mixto y de contacto total dominado por los animales más rápidos y feroces del mundo. A los nuevos compañeros de equipo de Will no les entusiasma tener a una cabrita en su plantilla, pero Will está decidido a revolucionar el deporte y demostrar de una vez por todas que «¡los pequeños saben jugar!».', 'https://image.tmdb.org/t/p/original/2yblKPC6ZKEU6iv9sEZ0jktjiTU.jpg', 'https://image.tmdb.org/t/p/original/4lo5yNZrMLPKBh47t2CoZkbAUur.jpg', 'https://www.youtube.com/watch?v=q56pw-zFDP8', 2026, 100);
